import { Avatar } from "@mui/material";
import React, { useState } from "react";
import "./ConvoScreen.css";

function ConvoScreen() {
  const [messages, setMessages] = useState([
    {
      name: "Doja Cat",
      src: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdVvRerDrym9S4A3tSngYlXDsOhKZ8mVsfRg&usqp=CAU",
      message: "Let me be your woman.. woman woman wman",
    },
    {
      name: "Doja Cat",
      src: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdVvRerDrym9S4A3tSngYlXDsOhKZ8mVsfRg&usqp=CAU",
      message: "lmao get it?",
    },
    {
      message: "Hey you in town?",
    },
  ]);
  return (
    <div className="ConvoScreen">
      <p className="ConvoScreen__match">
        You matched with Doja Cat on 06/13/2022
      </p>
      {messages.map((message) => {
        return message.name ? (
          <div className="ConvoScreen__timestamp">
            <Avatar alt={message.name} src={message.src} />
            <p className="ConvoScreen_message">{message.message}</p>
          </div>
        ) : (
          <p className="userMessage">{message.message}</p>
        );
      })}
    </div>
  );
}

export default ConvoScreen;
